import React, { useEffect, useState } from "react";
import { useSearchParams } from "react-router-dom";

function Home() {
  const [loggedInUser, setLoggedInUser] = useState("");

  useEffect(() => {
    setLoggedInUser(localStorage.getItem("loggedInUser"));
  }, []);

  return (
    <div>
      <h1>{loggedInUser}</h1>
    </div>
  );
}

export default Home;
